import React from 'react';
import { GlobalStyle, WeatherCard, Code, BreakLine, Subtitle } from '../../styles/styles';
import { findLanguageByKey } from '../../languages/Languages';
const SocialNetwork = (props) => {
	console.log(props);
	const fullLanguage = null;
	return (
		<>
			<GlobalStyle />
			<WeatherCard>
				<code>{fullLanguage.socialNetworks.myInfo}</code>
			</WeatherCard>
		</>
	);
};

export default SocialNetwork;
